import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after filling search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using multiple selector strategies
    const searchButton = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchButton.click();

    // Wait for search results to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot of results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const productTitles = await page.$$eval('.product-card .product-title', 
      titles => titles.map(t => t.textContent.trim())
    );

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured results",
      extractedData: {
        productCount: productTitles.length,
        productTitles: productTitles.slice(0, 5) // First 5 products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
